import logo from './logo.svg';
import './App.css';

function App() {
  const [data, setData] = useState(null);
  useEffect(() => {
    fetch("/api/idDemo")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <p>Value A: {data.a}</p>
        <p>Value B: {data.b}</p>
      </header>
    </div>
  );
}

export default App;
